import React, {useEffect} from 'react';
import {Fade} from 'react-reveal';

import gold from '../images/gold.png';


const LandingSection = (props) => {
    return (
        <div className="section landing-section">

            <div id="landing-logo-container" className="outer-row">
                <img id="mobile-logo" src={logo}></img>
            </div>

            <div className="manual-container">
                <Fade delay={800}>
                    <div className="manual-wrapper">
                        <img id="manual" src={manual}></img>
                        <img id="gold" src={gold}></img>
                    </div>
                </Fade>
            </div>

            <div id="arrow-container" className="outer-row">
                <Fade delay={2000}>
                    <img id="arrow" src={arrow}></img>
                </Fade>
            </div>

        </div> 

    )
}

export default LandingSection;
